primary_outcome.description:
The composite endpoint included any of the following:
Major amputation - amputation that resulted in limb shortening (e.g., proximal to, but not including transmetatarsal amputations);
Major graft reintervention - placement of a new bypass graft at the same anatomic site, a jump/interposition graft, graft thrombectomy, graft excision, or graft thrombolysis;
Procedure-related death - any death within 30 days of the index procedure or within 30 days of any remedial procedure performed at the same anatomic site or as a result of the index procedure.

criteria.textblock:
        Inclusion Criteria:

          -  Patient required either above-knee or below-knee femoral popliteal bypass;

          -  Patient had Category 1, 2, 3 4 or 5 chronic limb ischemia as defined by the Rutherford
             Categories - chronic limb ischemia severity classification scale.

          -  Patient was at least 21 years of age;

          -  Patient had postoperative life expectancy of >18 months;

          -  Patient was willing and able to have follow-up visits and examinations;

          -  Patient would not participate in other clinical trials that would conflict with this
             protocol

          -  Patient was willing and able to provide written, informed consent.

        Exclusion Criteria:

          -  Patient had a previous history of bypass in the diseased extremity (below the iliacs
             arteries);

          -  Patient had percutaneous transluminal angioplasty or stenting of the target femoral or
             popliteal artery at the anticipated site of the proximal or distal anastomosis within
             the previous 30 days;

          -  Patient had active infection in the region of graft placement;

          -  Patient had an acute arterial occlusion requiring an emergent intervention;

          -  Patient needed a cardiac surgical procedure or a different vascular surgical procedure
             within 30 days of planned lower extremity revascularization. Planned endovascular
             procedures to address proximal stenotic lesions at the time of the index
             femoropopliteal bypass did not exclude a patient from the study;

          -  Patient required sequential extremity revascularizations or other procedures that
             require use of additional vascular grafts;

          -  Patient had known hypersensitivity or contraindication to aspirin;

          -  Patient had known coagulation disorders including hypercoagulability;

          -  Patient had previous instance of heparin-induced thrombocytopenia type 2 or has known
             hypersensitivity to heparin; Patient was currently treated with Coumadin (warfarin)
             that had not been stopped within 72 hours of the planned procedure

          -  Patient had severe chronic renal insufficiency (plasma/serum creatinine > 2.5 mg/dl),
             is undergoing hemodialysis.

          -  Patient had prior renal transplant;

          -  Patient had a stroke or myocardial infarction within 6 weeks of the procedure or had
             evidence of prior massive stroke (Modified Rankin Scale 3 or above);

          -  Patient had a myocardial infarction within 6 weeks prior to the procedure or had
             unstable angina pectoris;

          -  Patient had documented acute or suspected systemic infection;

          -  Patient was a woman of reproductive potential.

